import { Box, Checkbox, TextField, Typography } from "@mui/material"
import Input from "./Input"
import ButtonCompo from "./button"
import "./Login.css"
import { FormEvent, FormEventHandler, useState } from "react"
import { loginDetails,signUpDetails } from "../typescriptDatatype/dataType"

export default function Login() {
  let [loginDetails, setLoginDetails] = useState<loginDetails>({
    loginEmail: "",
    loginPassword: "",
  })

  let [signupDetails,setSignupDetails] =useState<signUpDetails>({
    userName:"",
    userEmail:"",
    userPhone:"",
    userPassword:""

  })

  let [showHidePage, setshowHidePage] = useState<boolean>(false)

  // Login CX
  const loginCoustomer = (event: FormEvent<HTMLFormElement>): void => {
    event.preventDefault()
    console.log(loginDetails)
    console.log(signupDetails);

  }

  // input value
  const inputLogin = (loginInput: string, LoginName: string) => {

    if(showHidePage==true){
    setLoginDetails((prev) => {
      return {...prev,[loginInput]:LoginName}
    })
  }
  {
    setSignupDetails((prev) => {
      return {...prev,[loginInput]:LoginName}
    })
  }
  }
  // show hide
  const pageChangeLogin = (value: boolean): void => {
    setshowHidePage(value)
  }

  return (
    <>
      {showHidePage ? (
        <Box>
          <Box component={"section"} sx={style.box}>
            <Box
              sx={{
                display: "flex",
                height: "70vh",
                mt: "10%",
                width: "70%",
                boxShadow: "0px 0px 16px 4px",
              }}
            >
              <Box sx={{ width: 500, mr: 2 }}>
                <div className="firstbox">
                  <Typography
                    variant={"h4"}
                    style={{
                      margin: 4,
                      fontFamily: "Edu AU VIC WA NT Arrows ,cursive",
                      position: "relative",
                      top: "145px",
                      left: "75px",
                      fontSize: "55px",
                      width: "243px",
                    }}
                  >
                    Tip /Mart
                  </Typography>
                </div>
              </Box>
              <Box>
                <Typography
                  sx={{
                    position: "absolute",
                    left: "77%",
                    mt: 2,
                    fontFamily: "Dancing Script, serif",

                    cursor: "pointer",
                    border: "1px solid black",
                    padding: "3px",
                    width: "103px",
                    textAlign: "center",
                    borderRadius: "5px",
                    fontSize: "19px",
                  }}
                  component={"h5"}
                  onClick={() => pageChangeLogin(false)}
                >
                  Sign-up
                </Typography>
                <Box
                  component={"form"}
                  onSubmit={loginCoustomer}
                  sx={{
                    display: "flex",
                    justifyContent: "center",
                    alignItems: "",
                    height: "100%",
                    flexDirection: "column",
                  }}
                >
                  <Input
                    type="email"
                    label="Email Id"
                    style={{ mb: 1, width: 300 }}
                    name="loginEmail"
                    emailid={inputLogin}
                  />
                  <br></br>
                  <Input
                    type="password"
                    label="Password"
                    style={{ mt: 1, width: 300 }}
                    emailid={inputLogin}
                    name="loginPassword"
                  />
                  <br></br>
                  <div
                    style={{
                      display: "flex",
                      justifyContent: "space-between",
                      alignItems: "center",
                    }}
                  >
                    <Box
                      component={"div"}
                      sx={{
                        display: "flex",
                        justifyContent: "center",
                        alignItems: "center",
                      }}
                    >
                      {" "}
                      <Checkbox></Checkbox>
                      <Box component={"span"} sx={{ fontSize: "15px" }}>
                        Remember
                      </Box>
                    </Box>

                    <Box>
                      {" "}
                      <Box component={"span"} sx={{ fontSize: "15px", mb: 2 }}>
                        forgot password ?
                      </Box>
                    </Box>
                  </div>
                  <ButtonCompo
                    text={"Login"}
                    variant1="contained"
                    style={{ mt: 0, width: 100 }}
                    type="submit"
                  ></ButtonCompo>
                </Box>
              </Box>
            </Box>
          </Box>
        </Box>
      ) : (
        <Box className="sec-2">
          <Box component={"section"} sx={style.box}>
            <Box
              sx={{
                display: "flex",
                height: "70vh",
                mt: "10%",
                width: "70%",
                boxShadow: "0px 0px 16px 4px",
              }}
            >
              <Box sx={{ width: 500, mr: 2 }}>
                <div className="firstbox-signup">
                  <Typography
                    variant={"h4"}
                    style={{
                      margin: 4,
                      fontFamily: "Edu AU VIC WA NT Arrows ,cursive",
                      position: "relative",
                      top: "55px",
                      left: "75px",
                      fontSize: "55px",
                      width: "243px",
                    }}
                  >
                    Tip /Mart
                  </Typography>
                </div>
              </Box>
              <Box>
                <Typography
                  sx={{
                    position: "absolute",
                    left: "77%",
                    mt: 2,
                    fontFamily: "Dancing Script, serif",

                    cursor: "pointer",
                    border: "1px solid black",
                    padding: "3px",
                    width: "103px",
                    textAlign: "center",
                    borderRadius: "5px",
                    fontSize: "19px",
                  }}
                  component={"h4"}
                  onClick={() => {
                    pageChangeLogin(true)
                  }}
                >
                  Login
                </Typography>
                <Box
                  component={"form"}
                  onSubmit={loginCoustomer}
                  sx={{
                    display: "flex",
                    justifyContent: "center",
                    alignItems: "",
                    height: "100%",
                    flexDirection: "column",
                  }}
                >
                  <Input
                    type="text"
                    label="Name"
                    style={{ mb: 1, width: 300 }}
                    name="userName"
                    variant="standard"
                    emailid={inputLogin}
                  />{" "}
                  <br></br>
                  <Input
                    type="email"
                    label="Email Id"
                    style={{ mb: 1, width: 300 }}
                    name="userEmail"
                    variant="standard"
                    emailid={inputLogin}
                  />
                  <br></br>
                  <Input
                    type="Phone Number"
                    label="Phone no."
                    style={{ mb: 1, width: 300 }}
                    name="userPhone"
                    variant="standard"
                    emailid={inputLogin}
                  />
                  <br></br>
                  <Input
                    type="password"
                    label="Password"
                    style={{ mb: 1, width: 300 }}
                    variant="standard"
                    name="userPassword"
                    emailid={inputLogin}
                  />
                  <Input
                    type="password"
                    label="Re-Password"
                    style={{ mb: 1, width: 300 }}
                    variant="standard"
                    name="usermatchPassword"
                    emailid={inputLogin}
                  />
                  <br></br>
                  <ButtonCompo
                    text={"Sign-Up"}
                    variant1="contained"
                    style={{ mt: 0, width: 100 }}
                    type="submit"
                  ></ButtonCompo>
                </Box>
              </Box>
            </Box>
          </Box>
        </Box>
      )}
    </>
  )
}

const style = {
  box: {
    display: "flex",
    justifyContent: "center",
    height: "70vh",
    alignItems: "center",
  },
}
